import '../Styles/App.css';
import {Header, Divider, Grid, Button, Icon} from 'semantic-ui-react'

class Home extends React.Component {


    render() {

        return(


           <div className="welcome">

               <Header as='h3' textAlign='center' color='red'>
                  Welcome to my website!
                </Header>

                <Header as='h1' textAlign='center' className="white header-main">
                    My name is David and I am Junior Front-end Developer    
                </Header> <br/>

                <Divider horizontal>L</Divider>

                <Grid>
                    <Grid.Row columns={3}>

                            <Grid.Column>
                                     <Button> <Icon name='user'/> </Button>

                            </Grid.Column>
                    </Grid.Row>
                </Grid>

           </div>
        )
    }
}

export default Home
